import React from "react";
// import Profil from "./Profil";
import Right from "./Right";
export default function Body(){
    // let [but,change]=useState(<Right />)
    // let fun=()=>{
    //     console.log('hello')
    // }
    return (
        <div className="body">
            
            <Right column='4/6' rows='1/6' />

            <Profil  info={{
                column:'1' ,
                rows:'1',
                image:'/image/image-waffle-desktop.jpg' ,
                thename:"Waffle",
                discrption:'Waffle with Berries',
                slarey:'$6.50',
                class:'order'
            }}/>
            <Profil  info={{
                column:'2' ,
                rows:'1',
                image:'/image/image-creme-brulee-desktop.jpg' ,
                thename:"Crème Brûlée",
                discrption:'Vanilla Bean Crème Brûlée',
                slarey:'$7.00',
                class:'order'
            }}/>
            
            <Profil  info={{
                column:'3' ,
                rows:'1',
                image:'/image/image-macaron-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00',
                class:'order'

            }}/>
            <Profil  info={{
                column:'1' ,
                rows:'2',
                image:'/image/image-tiramisu-desktop.jpg' ,
                thename:"Tiramisu",
                discrption:'Classic Tiramisu',
                slarey:'$5.50',
                class:'order'

            }}/>
            <Profil  info={{
                column:'2' ,
                rows:'2',
                image:'/image/image-baklava-desktop.jpg' ,
                thename:"Baklava",
                discrption:'Pistachio Baklava',
                slarey:'$4.00',
                class:'order'

            }}/>
            <Profil  info={{
                column:'3' ,
                rows:'2',
                image:'/image/image-meringue-desktop.jpg' ,
                thename:"Pie",
                discrption:'Lemon Meringue Pie',
                slarey:'$5.00',
                class:'order'

            }}/>

             <Profil  info={{
                column:'1' ,
                rows:'3',
                image:'/image/image-cake-desktop.jpg' ,
                thename:"Cake",
                discrption:'Red Velvet Cake',
                slarey:'$4.50',
                class:'order'

            }}/>
             <Profil  info={{
                column:'2' ,
                rows:'3',
                image:'/image/image-brownie-desktop.jpg' ,
                thename:"Brownie",
                discrption:'Salted Caramel Brownie',
                slarey:'$5.50',
                class:'order'

            }}/>
             <Profil  info={{
                column:'3' ,
                rows:'3',
                image:'/image/image-panna-cotta-desktop.jpg' ,
                thename:"Panna Cotta",
                discrption:'Vanilla Panna Cotta',
                slarey:'$6.50',
                class:'order'

            }}/>
            
            

        </div>
    );
}
function Profil(prop){
    let [but,change]=useState()
    let fun=(e)=>{
        // let button=document.getElementById('basic')
        e.target.style.display='none'
        change(<Anotherbutton/>)

    }
    return(
        <div className="card" style={{gridColumn:prop.info.column,gridRow:prop.info.rows}}>
        <div className="card-item" style={{backgroundImage:`url(${prop.info.image})`}}>
            
            <button id="basic" onClick={fun} className={prop.info.class}>
            <svg xmlns="http://www.w3.org/2000/svg" width="28" height="20" fill="none" viewBox="0 0 21 20"><g fill="#C73B0F" clip-path="url(#a)"><path d="M6.583 18.75a1.25 1.25 0 1 0 0-2.5 1.25 1.25 0 0 0 0 2.5ZM15.334 18.75a1.25 1.25 0 1 0 0-2.5 1.25 1.25 0 0 0 0 2.5ZM3.446 1.752a.625.625 0 0 0-.613-.502h-2.5V2.5h1.988l2.4 11.998a.625.625 0 0 0 .612.502h11.25v-1.25H5.847l-.5-2.5h11.238a.625.625 0 0 0 .61-.49l1.417-6.385h-1.28L16.083 10H5.096l-1.65-8.248Z"/><path d="M11.584 3.75v-2.5h-1.25v2.5h-2.5V5h2.5v2.5h1.25V5h2.5V3.75h-2.5Z"/></g><defs><clipPath id="a"><path fill="#fff" d="M.333 0h20v20h-20z"/></clipPath></defs></svg>
            Add to Cart
                </button>
                {but}
        </div>
        <div className="string">
            <span>{prop.info.thename}</span>
            <span>{prop.info.discrption}</span>
            <span>{prop.info.slarey}</span>
        </div>
        </div>
      
    );
}
function Anotherbutton(){
    let [mins,setmins]=useState(0)
    
    let but_mins=()=>{setmins(mins--)}
    let but_plas=()=>{setmins(mins++)}
    return(
        <button className="other ">
            
            <button className="cyrcle" onClick={but_mins}>-</button>
                {mins}
            <button className="cyrcle" onClick={but_plas}>+</button>
            
            
        </button>
    )
}
